import React from 'react';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { NavLink } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';


function NavBar() {





    return (
        <div>
            <Navbar bg="light" variant="light">
                <Container>
                    <Navbar.Brand ><Link className='text-decoration-none text-dark mx-3' to={"/"}>LocalStore</Link></Navbar.Brand>
                    <Nav className="me-auto">
                        <NavLink to={"/products/categories/smartphones"} ><Button className='mx-2'>Smartphones</Button></NavLink>
                        <NavLink to={"/products/categories/laptops"} ><Button className='mx-2'>Laptops</Button></NavLink>
                        <NavLink to={"/products/categories/mens-watches"} ><Button className='mx-2'>Men's Watches</Button></NavLink>
                        <NavLink to={"/products/categories/womens-watches"} ><Button className='mx-2'>Woman's Watches</Button></NavLink>
                    </Nav>
                </Container>
            </Navbar>
        </div>
    );
}

export default NavBar;
